// NO SCALER - Model was trained WITHOUT StandardScaler
// Do NOT apply scaling in C++ implementation

// Traverse a single tree
inline double traverseTree(const TreeNode* tree, int tree_size, const double* x) {
    int node = 0;
    while (node >= 0 && node < tree_size) {
        const TreeNode& n = tree[node];
        if (n.feature < 0) {
            return n.value;  // Leaf node
        }
        if (x[n.feature] < n.threshold) {
            node = n.left;
        } else {
            node = n.right;
        }
    }
    return 0.0;
}

// Main prediction function
// Input: unified feature vector (4093 features: 291 SMARTS + 217 RDKit + 3585 Osmordred)
//        After preprocessing: infânan, arcsinh(|x|>33)
inline double predict(const double* unified_features) {
    // Select features using FEATURE_MASK
    double x[N_FEATURES];
    for (int i = 0; i < N_FEATURES; ++i) {
        int idx = FEATURE_MASK[i];
        if (idx >= 0 && idx < 4093) {
            x[i] = unified_features[idx];
        } else {
            x[i] = 0.0;
        }
    }
    
    // Apply scaling if scaler is available
    // NO SCALING - Model was trained without StandardScaler
    
    // Sum predictions from all trees
    double sum = BASE_SCORE;
    for (int t = 0; t < N_TREES; ++t) {
        sum += LEARNING_RATE * traverseTree(TREES[t], TREE_SIZES[t], x);
    }
    return sum;
}

